import React, { useState } from 'react';
import axios from 'axios';
import '../Style/AdminPage.css';

const AdminPage = () => {
    const [carDetails, setCarDetails] = useState({
        make: '',
        name: '',
        year: '',
        bodyStyle: '',
        odometer: '',
        transmission: '',
        engine: '',
        fuelType: '',
        color: '',
        passengers: '',
        price: '',
        description: '',
        image: '',
    });

    const [inventory, setInventory] = useState([]);

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setCarDetails({ ...carDetails, [name]: value });
    };

    const handleImageChange = (e) => {
        setCarDetails({ ...carDetails, image: e.target.files[0] });
    };

    const handleAddCar = async (e) => {
        e.preventDefault();

        const formData = new FormData();
        Object.entries(carDetails).forEach(([key, value]) => {
            formData.append(key, value);
        });

        try {
            const response = await axios.post('http://localhost:8081/api/inventory', formData, {
                headers: {
                    'Content-Type': 'multipart/form-data',
                },
            });
            alert('Car added successfully!');
            setInventory([...inventory, response.data]);
        } catch (error) {
            console.error('Error adding car:', error);
            alert('Failed to add car. Please try again.');
        }
    };

    return (
        <div className="admin-dashboard">
            <h1>Admin Dashboard</h1>

            <div className="add-car-form">
                <h2>Add New Car</h2>
                <form onSubmit={handleAddCar}>
                    <label>
                        Make:
                        <input type="text" name="make" value={carDetails.make} onChange={handleInputChange} required />
                    </label>
                    <label>
                        Name:
                        <input type="text" name="name" value={carDetails.name} onChange={handleInputChange} required />
                    </label>
                    <label>
                        Year:
                        <input type="number" name="year" value={carDetails.year} onChange={handleInputChange} />
                    </label>
                    <label>
                        Body Style:
                        <input type="text" name="bodyStyle" value={carDetails.bodyStyle} onChange={handleInputChange} />
                    </label>
                    <label>
                        Odometer:
                        <input type="number" name="odometer" value={carDetails.odometer} onChange={handleInputChange} />
                    </label>
                    <label>
                        Transmission:
                        <input type="text" name="transmission" value={carDetails.transmission} onChange={handleInputChange} />
                    </label>
                    <label>
                        Engine:
                        <input type="text" name="engine" value={carDetails.engine} onChange={handleInputChange} />
                    </label>
                    <label>
                        Fuel Type:
                        <input type="text" name="fuelType" value={carDetails.fuelType} onChange={handleInputChange} />
                    </label>
                    <label>
                        Color:
                        <input type="text" name="color" value={carDetails.color} onChange={handleInputChange} />
                    </label>
                    <label>
                        Passengers:
                        <input type="number" name="passengers" value={carDetails.passengers} onChange={handleInputChange} />
                    </label>
                    <label>
                        Price:
                        <input type="number" name="price" value={carDetails.price} onChange={handleInputChange} required />
                    </label>
                    <label>
                        Description:
                        <textarea name="description" value={carDetails.description} onChange={handleInputChange}></textarea>
                    </label>
                    <label>
                        Image:
                        <input type="file" name="image" onChange={handleImageChange} />
                    </label>
                    <button type="submit">Add Car</button>
                </form>
            </div>
        </div>
    );
};

export default AdminPage;
